import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";

const Navbar = () => {
  
  const [employee, setEmployee]= useState()
  const toLoad=sessionStorage.getItem('token')
  var x= false;

  console.log(toLoad);
  
  useEffect(() => {
  var config = {
    method: 'get',
    url: 'http://ec2-13-234-32-167.ap-south-1.compute.amazonaws.com:8081/hms/admin/findEmpById?id='+ sessionStorage.getItem('empId'),
    headers: { 
        'Authorization': 'Bearer '+sessionStorage.getItem('token')
    }
   
};

axios(config)
.then(function (response) {
    console.log(JSON.stringify(response.data));
    // navigate('/viewemp')
      setEmployee(response.data)
      x=true;
})
.catch(function (error) {
    console.log(error);
    x=false;
});


  },[])


  return (
    <nav
      className="navbar navbar-light  justify-content-between"
      Style="box-shadow: 0px 0px 4px;height:11vh;background-color:rgba(5, 163, 144); color:white">
        <h3 style={{marginLeft:20}}>Hospital Management System</h3>
        
       {x?<h4>Welcome: {employee.empName}</h4>:null}
      <a className="navbar-brand" Style="color:white">
    
      </a>
     
    </nav>
  );
};
export default Navbar;
